-->\r\n                <div ko-scope=\"getLinkedElementName()\" class=\"url-input-element-linked-element\">\r\n                    <render></render>\r\n                    <label class=\"admin__field-error\" visible=\"error\" attr=\"for: uid\" text=\"error\"></label>\r\n                </div>\r\n            </div>\r\n\r\n        <!--display container to specify url options(Example: open in new tab)-->\r\n        <div render=\"settingTemplate\" if=\"isDisplayAdditionalSettings\"></div>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/form/element/wysiwyg.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<div class=\"admin__control-wysiwig\" data-bind=\"html: content\"></div>\r\n","Magento_Ui/templates/form/element/helper/fallback-reset.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<button class=\"admin__field-fallback-reset\"\r\n        type=\"button\"\r\n        click=\"element.restoreToDefault\">\r\n        <span translate=\"'Use Default Value'\"></span>\r\n</button>\r\n","Magento_Ui/templates/form/element/helper/service.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__field-service\">\r\n    <input type=\"checkbox\"\r\n           class=\"admin__control-checkbox\"\r\n           attr=\"\r\n                id: $data.uid + '_default',\r\n                name: 'use_default[' + $data.index + ']',\r\n           \"\r\n           ko-checked=\"isUseDefault\"\r\n           ko-disabled=\"$data.serviceDisabled\">\r\n    <label translate=\"'Use Default Value'\" attr=\"for: $data.uid + '_default'\" class=\"admin__field-label\"></label>\r\n</div>\r\n","Magento_Ui/templates/form/element/helper/tooltip.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n <div class=\"field-tooltip toggle\">\r\n\r\n    <!-- ko if: (tooltip.link)-->\r\n    <a class=\"field-tooltip-action action-help\"\r\n       target=\"_blank\"\r\n       data-toggle=\"dropdown\"\r\n       data-bind=\"attr: {href: tooltip.link}, mageInit: {'dropdown':{'activeClass': '_active'}}\"></a>\r\n     <!-- /ko -->\r\n\r\n     <span class=\"label\" data-bind=\"attr: { id: $data.tooltipId ? $data.tooltipId : 'tooltip-label' }\"><!-- ko i18n: 'Tooltip' --><!-- /ko --></span>\r\n     <!-- ko if: (!tooltip.link)-->\r\n         <span\r\n             class=\"field-tooltip-action action-help\"\r\n             tabindex=\"0\"\r\n             data-toggle=\"dropdown\"\r\n             data-bind=\"\r\n                mageInit: {'dropdown':{'activeClass': '_active', 'parent': '.field-tooltip.toggle'}},\r\n                attr: { 'aria-labelledby': $data.tooltipId ? $data.tooltipId : 'tooltip-label' }\r\n            \"\r\n         >\r\n         </span>\r\n     <!-- /ko -->\r\n\r\n     <div class=\"field-tooltip-content\"\r\n         data-target=\"dropdown\" translate=\"tooltip.description\">\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/form/element/uploader/image.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__field\" visible=\"visible\" css=\"$data.additionalClasses\">\r\n    <label class=\"admin__field-label\" if=\"$data.label\" attr=\"for: uid\">\r\n        <span translate=\"label\" attr=\"'data-config-scope': $data.scopeLabel\"></span>\r\n    </label>\r\n\r\n    <div class=\"admin__field-control\" css=\"'_with-tooltip': $data.tooltip\">\r\n        <div class=\"file-uploader image-uploader\" data-role=\"drop-zone\" css=\"_loading: isLoading\">\r\n            <div class=\"file-uploader-area\">\r\n                <input type=\"file\" afterRender=\"onElementRender\" attr=\"id: uid, name: inputName, multiple: isMultipleFiles\" disable=\"disabled\" />\r\n                <label class=\"file-uploader-button action-default\" attr=\"for: uid, disabled: disabled\" disable=\"disabled\" translate=\"'Upload'\"></label>\r\n                <label\r\n                    data-bind=\"event: {change: addFileFromMediaGallery, click: openMediaBrowserDialog}\"\r\n                    class=\"file-uploader-button action-default\"\r\n                    attr=\"id: mediaGalleryUid, disabled: disabled\"\r\n                    data-force_static_path=\"1\"\r\n                    translate=\"'Select from Gallery'\"></label>\r\n                <render args=\"fallbackResetTpl\" if=\"$data.showFallbackReset && $data.isDifferedFromDefault\"></render>\r\n                <p class=\"image-upload-requirements\">\r\n                    <span if=\"$data.maxFileSize\">\r\n                        <span translate=\"'Maximum file size'\"></span>: <text args=\"formatSize($data.maxFileSize)\"></text>.\r\n                    </span>\r\n                    <span if=\"$data.allowedExtensions\">\r\n                        <span translate=\"'Allowed file types'\"></span>: <text args=\"getAllowedFileExtensionsInCommaDelimitedFormat()\"></text>.\r\n                    </span>\r\n                </p>\r\n            </div>\r\n\r\n            <render args=\"tooltipTpl\" if=\"$data.tooltip\"></render>\r\n\r\n            <div class=\"admin__field-note\" if=\"$data.notice\" attr=\"id: noticeId\">\r\n                <!-- ko with: {noticeUnsanitizedHtml: notice} -->\r\n                <span html=\"noticeUnsanitizedHtml\"></span>\r\n                <!-- /ko -->\r\n            </div>\r\n\r\n            <label class=\"admin__field-error\" if=\"error\" attr=\"for: uid\" text=\"error\"></label>\r\n\r\n            <each args=\"data: value, as: '$file'\" render=\"$parent.getPreviewTmpl($file)\"></each>\r\n\r\n            <div if=\"!hasData()\" class=\"image image-placeholder\" click=\"triggerImageUpload\">\r\n                <div class=\"file-uploader-summary product-image-wrapper\">\r\n                    <div class=\"file-uploader-spinner image-uploader-spinner\"></div>\r\n                    <p class=\"image-placeholder-text\" translate=\"'Browse to find or drag image here'\"></p>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <render args=\"$data.service.template\" if=\"$data.hasService()\"></render>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/form/element/uploader/preview.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"file-uploader-summary\">\r\n    <div class=\"file-uploader-preview\">\r\n        <a class=\"preview-link\"\r\n           css=\"'preview-' + $file.previewType\"\r\n           attr=\"href: $parent.getFilePreview($file), title: $file.name\" target=\"_blank\">\r\n            <img\r\n                if=\"$file.previewType === 'image'\"\r\n                tabindex=\"0\"\r\n                event=\"load: $parent.onPreviewLoad.bind($parent)\"\r\n                attr=\"\r\n                    src: $parent.getFilePreview($file),\r\n                    alt: $file.name\"/>\r\n        </a>\r\n\r\n        <div class=\"actions\">\r\n            <button\r\n                type=\"button\"\r\n                class=\"action-remove\"\r\n                data-role=\"delete-button\"\r\n                attr=\"title: $t('Delete image')\"\r\n                click=\"$parent.removeFile.bind($parent, $file)\">\r\n                <span translate=\"'Delete image'\"></span>\r\n            </button>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"file-uploader-filename\" text=\"$file.name\"></div>\r\n\r\n    <div class=\"file-uploader-meta\">\r\n        <span if=\"$file.previewType === 'image'\">\r\n            <text args=\"$file.previewWidth\"></text>x<text args=\"$file.previewHeight\"></text>,\r\n        </span>\r\n        <text args=\"$parent.formatSize($file.size)\"></text>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/form/element/uploader/uploader.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<div class=\"field-control\" css=\"'_with-tooltip': $data.tooltip\">\r\n    <div class=\"file-uploader\" data-role=\"drop-zone\" css=\"_loading: isLoading\">\r\n        <div class=\"file-uploader-area\">\r\n            <input type=\"file\" afterRender=\"onElementRender\" attr=\"id: uid, name: inputName, multiple: isMultipleFiles\"\r\n                   disable=\"disabled\"/>\r\n            <label class=\"file-uploader-button action-default\" attr=\"for: uid\" translate=\"'Upload'\"></label>\r\n\r\n            <span class=\"file-uploader-spinner\"></span>\r\n            <render args=\"fallbackResetTpl\" if=\"$data.showFallbackReset && $data.isDifferedFromDefault\"></render>\r\n        </div>\r\n\r\n        <render args=\"tooltipTpl\" if=\"$data.tooltip\"></render>\r\n\r\n        <div class=\"field-note\" if=\"$data.notice\" attr=\"id: noticeId\">\r\n            <span><strong translate=\"NOTE\"></strong>: <translate args=\"$data.notice\"></translate></span>\r\n        </div>\r\n\r\n        <each args=\"data: value, as: '$file'\" render=\"$parent.getPreviewTmpl($file)\"></each>\r\n\r\n        <div if=\"isMultipleFiles\" class=\"file-uploader-summary\">\r\n            <label attr=\"for: uid\"\r\n                   class=\"file-uploader-placeholder\"\r\n                   css=\"'placeholder-' + placeholderType\">\r\n                    <span class=\"file-uploader-placeholder-text\"\r\n                          translate=\"'Click here or drag and drop to add files.'\"></span>\r\n            </label>\r\n        </div>\r\n    </div>\r\n    <render args=\"$data.service.template\" if=\"$data.hasService()\"></render>\r\n</div>\r\n","Magento_Ui/templates/form/element/urlInput/setting.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<!--display container to specify url options(Example: open in new tab)-->\r\n<div class=\"admin__field admin__field-option url-input-setting\" visible=\"visible\" click=\"checkboxClick\">\r\n    <input type=\"checkbox\"\r\n           class=\"admin__control-checkbox\"\r\n           ko-checked=\"settingValue\"\r\n           disable=\"disabled\"\r\n           ko-value=\"settingValue\"\r\n           attr=\"id: uid, name: inputName\"/>\r\n\r\n    <label class=\"admin__field-label\" text=\"settingLabel\" attr=\"for: uid\"></label>\r\n</div>\r\n","Magento_Ui/templates/form/element/urlInput/typeSelector.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<select class=\"admin__control-select url-input-select\" data-bind=\"\r\n    attr: {\r\n        name: inputName,\r\n        id: uid,\r\n        disabled: disabled,\r\n        visible: visible,\r\n        'aria-describedby': noticeId\r\n    },\r\n    hasFocus: focused,\r\n    optgroup: options,\r\n    value: linkType,\r\n    optionsValue: 'value',\r\n    optionsText: 'label'\"></select>\r\n","Magento_Ui/templates/grid/actions.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"action-select-wrap\" collapsible=\"onTarget: true\">\r\n    <button class=\"action-select\" translate=\"'Actions'\"></button>\r\n    <ul class=\"action-menu\"css=\"_active: $collapsible.opened\">\r\n        <li repeat=\"foreach: actions, item: '$action'\" click=\"applyAction.bind($data, $action().type)\">\r\n            <span class=\"action-menu-item\" text=\"$action().label\"></span>\r\n        </li>\r\n    </ul>\r\n</div>\r\n","Magento_Ui/templates/grid/exportButton.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<div class=\"admin__action-dropdown-wrap admin__data-grid-action-export\" collapsible>\r\n    <button class=\"admin__action-dropdown\" type=\"button\" toggleCollapsible>\r\n        <span class=\"admin__action-dropdown-text\" translate=\"'Export'\"></span>\r\n    </button>\r\n    <div class=\"admin__action-dropdown-menu admin__data-grid-action-export-menu\">\r\n        <div class=\"admin__field admin__field-option\" outereach=\"options\">\r\n            <input class=\"admin__control-radio\" type=\"radio\"\r\n                data-bind=\"\r\n                    attr: {\r\n                        id: ++ko.uid\r\n                    },\r\n                    checkedValue: value,\r\n                    checked: $parent.checked\"/>\r\n            <label class=\"admin__field-label\" text=\"label\" attr=\"for: ko.uid\"></label>\r\n        </div>\r\n        <div class=\"admin__action-dropdown-footer-main-actions\">\r\n            <button class=\"action-tertiary\" type=\"button\" translate=\"'Cancel'\" closeCollapsible></button>\r\n            <button class=\"action-secondary\" type=\"button\" translate=\"'Export'\" click=\"applyOption\"></button>\r\n        </div>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/listing.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__data-grid-wrap\" data-role=\"grid-wrapper\">\r\n    <table class=\"data-grid\" data-role=\"grid\">\r\n       <thead>\r\n            <tr each=\"data: getVisible(), as: '$col'\" render=\"getHeader()\"></tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr class=\"data-row\" repeat=\"foreach: rows, item: '$row'\" css=\"'_odd-row': $index % 2\">\r\n                <td outerfasteach=\"data: getVisible(), as: '$col'\"\r\n                    css=\"getFieldClass($row())\" click=\"getFieldHandler($row())\" template=\"getBody()\"></td>\r\n            </tr>\r\n            <tr ifnot=\"hasData()\" class=\"data-grid-tr-no-data\">\r\n                <td attr=\"colspan: countVisible()\" translate=\"'We couldn\\'t find any records.'\"></td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n</div>\r\n","Magento_Ui/templates/grid/masonry.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div data-role=\"grid-wrapper\" class=\"masonry-image-grid\" attr=\"'data-id': containerId\">\r\n    <div class=\"masonry-image-column\" repeat=\"foreach: rows, item: '$row'\">\r\n        <div outerfasteach=\"data: getVisible(), as: '$col'\" template=\"getBody()\"></div>\r\n    </div>\r\n    <div if=\"!hasData() && !getErrorMessageUnsanitizedHtml()\" class=\"no-data-message-container\">\r\n        <span translate=\"'We couldn\\'t find any records.'\"></span>\r\n    </div>\r\n    <div if=\"getErrorMessageUnsanitizedHtml()\" class=\"error-message-container\">\r\n        <span html=\"getErrorMessageUnsanitizedHtml()\"></span>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/paging-total.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__control-support-text\">\r\n    <!-- ko if: showTotalRecords -->\r\n    <text args=\"totalRecords\"></text> <!-- ko i18n: 'records found' --><!-- /ko -->\r\n    <!-- /ko -->\r\n    <!-- ko if: totalSelected && showTotalRecords -->\r\n    (<text args=\"totalSelected\"></text> <!-- ko i18n: 'selected' --><!-- /ko -->)\r\n    <!-- /ko -->\r\n</div>\r\n","Magento_Ui/templates/grid/sortBy.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div if=\"isVisible\" class=\"masonry-image-sortby\">\r\n    <b><!-- ko i18n: 'Sort by' --><!-- /ko -->:</b>\r\n    <select class=\"admin__control-select\" data-bind=\"\r\n        options: options,\r\n        optionsValue: 'value',\r\n        optionsText: 'label',\r\n        value: selectedOption\r\n    \"></select>\r\n</div>\r\n","Magento_Ui/templates/grid/submenu.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<ul class=\"action-submenu\" each=\"data: action.actions, as: 'action'\" css=\"_active: action.visible\">\r\n    <li css=\"_visible: $data.visible\">\r\n        <span class=\"action-menu-item\" translate=\"label\" click=\"$parent.applyAction.bind($parent, type)\"></span>\r\n        <render args=\"name: $parent.submenuTemplate, data: $parent\" if=\"$data.actions\"></render>\r\n    </li>\r\n</ul>\r\n","Magento_Ui/templates/grid/toolbar.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__data-grid-header\" afterRender=\"$data.setToolbarNode\">\r\n    <div class=\"admin__data-grid-header-row\">\r\n        <div class=\"admin__data-grid-actions-wrap\" each=\"getRegion('dataGridActions')\" render=\"\"></div>\r\n        <each args=\"getRegion('dataGridFilters')\" render=\"\"></each>\r\n    </div>\r\n    <div class=\"admin__data-grid-header-row row row-gutter\">\r\n        <div class=\"col-xs-2\" if=\"hasChild('listing_massaction')\" ko-scope=\"requestChild('listing_massaction')\" render=\"\"></div>\r\n        <div css=\"\r\n            'col-xs-10': hasChild('listing_massaction'),\r\n            'col-xs-12': !hasChild('listing_massaction')\">\r\n            <div class=\"row\" ko-scope=\"requestChild('listing_paging')\">\r\n                <div class=\"col-xs-3\" render=\"totalTmpl\"></div>\r\n                <div class=\"col-xs-9\" render=\"\"></div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<render args=\"stickyTmpl\" if=\"$data.sticky\"></render>\r\n","Magento_Ui/templates/grid/tree-massactions.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"action-select-wrap\" css=\"_active: opened\" outerClick=\"close.bind($data)\">\r\n    <button class=\"action-select\" attr=\"title: $t('Select Items')\" click=\"toggleOpened\">\r\n        <span translate=\"'Actions'\"></span>\r\n    </button>\r\n    <div class=\"action-menu-items\">\r\n        <ul class=\"action-menu\" each=\"data: actions, as: 'action'\" css=\"_active: opened\">\r\n            <li css=\"_visible: $data.visible, _parent: $data.actions\">\r\n                <span class=\"action-menu-item\" translate=\"label\" click=\"$parent.applyAction.bind($parent, type)\"></span>\r\n                <render args=\"name: $parent.submenuTemplate, data: $parent\" if=\"$data.actions\"></render>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/view-switcher.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<div class=\"admin__action-dropdown-wrap admin__action-grid-select\">\r\n    <select\r\n        class=\"admin__control-select\"\r\n        options=\"getDisplayModes()\"\r\n        ko-value=\"displayMode\"\r\n        optionsValue=\"'value'\"\r\n        optionsText=\"'label'\"\r\n    ></select>\r\n</div>\r\n","Magento_Ui/templates/grid/cells/actions.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<a\r\n    class=\"action-menu-item\"\r\n    if=\"$col.isSingle($row()._rowIndex)\"\r\n    repeat=\"foreach: $col.getVisibleActions($row()._rowIndex), item: '$action'\"\r\n    click=\"$col.getActionHandler($action())\"\r\n    text=\"$action().label\"\r\n    attr=\"target: $col.getTarget($action()), href: $action().href, 'aria-label': $action().ariaLabel\"></a>\r\n\r\n<div class=\"action-select-wrap\" if=\"$col.isMultiple($row()._rowIndex)\" collapsible>\r\n    <button class=\"action-select\" translate=\"'Select'\" toggleCollapsible></button>\r\n    <ul class=\"action-menu\" css=\"_active: $collapsible.opened\">\r\n        <li repeat=\"foreach: $col.getVisibleActions($row()._rowIndex), item: '$action'\">\r\n            <a class=\"action-menu-item\" click=\"$col.getActionHandler($action())\" text=\"$action().label\" attr=\"target: $col.getTarget($action()), href: $action().href, 'data-action': 'item-' + $action().index\"></a>\r\n        </li>\r\n    </ul>\r\n</div>\r\n","Magento_Ui/templates/grid/cells/expandable.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"data-grid-cell-content\">\r\n    <span text=\"$col.getFullLabel($row())\" ifnot=\"$col.isExpandable($row())\"></span>\r\n\r\n    <div if=\"$col.isExpandable($row())\">\r\n        <div text=\"$col.getShortLabel($row())\" class=\"admin__control-short-label\"></div>\r\n        <a attr=\"'data-tooltip-trigger': ++ko.uid\" translate=\"'Show more'\"></a>\r\n        <div\r\n            tooltip=\"\r\n                tooltipClasses: 'data-grid-column-tooltip',\r\n                trigger: '[data-tooltip-trigger=' + ko.uid + ']',\r\n                action: 'click',\r\n                delay: 0,\r\n                center: true,\r\n                position: 'top',\r\n                closeButton: true,\r\n                closeOnScroll: false\r\n            \">\r\n            <div render=\"$data.tooltipTmpl\"></div>\r\n        </div>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/cells/html.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"data-grid-cell-content\" html=\"$col.getLabelUnsanitizedHtml($row())\"></div>\r\n","Magento_Ui/templates/grid/cells/link.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"data-grid-cell-content\"\r\n     if=\"!$col.isLink($row())\"\r\n     text=\"$col.getLabel($row())\"></div>\r\n<a   class=\"action-menu-item\"\r\n     if=\"$col.isLink($row())\"\r\n     text=\"$col.getLabel($row())\"\r\n     attr=\"href: $col.getLink($row())\"></a>\r\n","Magento_Ui/templates/grid/cells/multiselect.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<label class=\"data-grid-checkbox-cell-inner\">\r\n    <input class=\"admin__control-checkbox\" type=\"checkbox\" data-action=\"select-row\"\r\n        data-bind=\"\r\n            staticChecked: $col.selected,\r\n            disable: $col.disabled.indexOf($row()[$col.indexField]) != -1 ,\r\n            checkedValue: $row()[$col.indexField],\r\n            attr: {\r\n                id: index + 'check' + $row()[$col.indexField]\r\n            }\"/>\r\n    <label attr=\"for: index + 'check' + $row()[$col.indexField]\"></label>\r\n</label>\r\n","Magento_Ui/templates/grid/cells/onoff.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__actions-switch\">\r\n    <input class=\"admin__actions-switch-checkbox\"\r\n           type=\"checkbox\"\r\n           data-bind=\"\r\n               staticChecked: $col.selected,\r\n               value: $row()[$col.indexField],\r\n               attr: {\r\n                   id: 'check' + $row()[$col.indexField]\r\n               }\"/>\r\n    <label class=\"admin__actions-switch-label\"\r\n           data-bind=\"\r\n               attr: {\r\n                   for: 'check' + $row()[$col.indexField]\r\n               }\">\r\n        <span data-bind=\"attr: {\r\n                   'data-text-on': $t('Yes'),\r\n                   'data-text-off': $t('No')\r\n              }\"\r\n              class=\"admin__actions-switch-text\"></span>\r\n    </label>\r\n</div>\r\n","Magento_Ui/templates/grid/cells/sanitizedHtml.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"data-grid-cell-content\" html=\"getSafeUnsanitizedHtml($col.getLabel($row()))\"></div>\r\n","Magento_Ui/templates/grid/cells/text.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"data-grid-cell-content\" text=\"$col.getLabel($row())\"></div>\r\n","Magento_Ui/templates/grid/cells/thumbnail.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<span class=\"thumbnail-container\">\r\n    <span class=\"thumbnail-wrapper\">\r\n        <img class=\"admin__control-thumbnail\" attr=\"src: $col.getSrc($row()), alt: $col.getAlt($row())\" loading=\"lazy\"/>\r\n    </span>\r\n</span>\r\n","Magento_Ui/templates/grid/cells/expandable/content.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__tooltip-title\" if=\"$data.tooltipTitle.length\">\r\n    <span translate=\"$data.tooltipTitle\"></span>\r\n</div>\r\n<ul class=\"items\">\r\n    <li class=\"item\" repeat=\"foreach: $col.getLabelsArray($row()), item: '$item'\">\r\n        <span text=\"$item()\"></span>\r\n    </li>\r\n</ul>\r\n","Magento_Ui/templates/grid/cells/thumbnail/preview.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<div class=\"thumbnail-preview\" data-role=\"thumbnail-preview\">\r\n    <div class=\"thumbnail-preview-image-block\">\r\n        <img class=\"thumbnail-preview-image\" src=\"<%- src %>\" alt=\"<%- alt %>\" loading=\"lazy\"/>\r\n    </div>\r\n    <div class=\"thumbnail-preview-content\">\r\n        <a class=\"thumbnail-preview-link\" href=\"<%- link %>\"><%- linkText %></a>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/columns/image-preview.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"masonry-image-preview\" if=\"$col.isVisible($row())\" data-image-preview ko-style=\"$col.getStyles($row())\">\r\n    <div class=\"container\">\r\n        <div class=\"action-buttons\">\r\n            <button class=\"action-previous\" type=\"button\" click=\"$col.prev.bind($col, $row())\">\r\n                <span translate=\"'Previous'\"></span>\r\n            </button>\r\n            <button class=\"action-next\" type=\"button\" click=\"$col.next.bind($col, $row())\">\r\n                <span translate=\"'Next'\"></span>\r\n            </button>\r\n            <button class=\"action-close\" type=\"button\" click=\"$col.hide.bind($col)\">\r\n                <span translate=\"'Close'\"></span>\r\n            </button>\r\n        </div>\r\n        <img class=\"preview\" attr=\"src: $col.getUrl($row()), alt: $col.getTitle($row())\"/>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/columns/image.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"masonry-image-block\" ko-style=\"$col.getStyles($row())\" css=\"{'active': $col.getIsActive($row())}\" attr=\"'data-id': $col.getId($row())\">\r\n    <img data-bind=\"event: { load: updateStyles($row()) }\" attr=\"src: $col.getUrl($row())\" css=\"$col.getClasses($row())\" click=\"function(){ expandPreview($row()) }\" data-role=\"thumbnail\"/>\r\n</div>\r\n","Magento_Ui/templates/grid/columns/multiselect.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<th class=\"data-grid-multicheck-cell\">\r\n    <div class=\"action-multicheck-wrap\" css=\"_disabled: !totalRecords()\" collapsible=\"\">\r\n        <input class=\"admin__control-checkbox\" type=\"checkbox\"\r\n            data-bind=\"\r\n                checked: allSelected(),\r\n                attr: {id: ++ko.uid},\r\n                event: { change: togglePage },\r\n                css: { '_indeterminate': indetermine },\r\n                enable: totalRecords\"/>\r\n        <label attr=\"for: ko.uid\"></label>\r\n        <button class=\"action-multicheck-toggle\" data-toggle=\"dropdown\"\r\n            data-bind=\"css: { '_active': $collapsible.opened },\r\n                       enable: totalRecords,\r\n                       toggleCollapsible\">\r\n            <span translate=\"'Options'\"></span>\r\n        </button>\r\n        <ul class=\"action-menu\" each=\"actions\" closeCollapsible=\"\">\r\n            <li data-bind=\"click: $parent[value].bind($parent),\r\n                           visible: $parent.isActionRelevant(value)\">\r\n                <span class=\"action-menu-item\" text=\"label\"></span>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</th>\r\n","Magento_Ui/templates/grid/columns/onoff.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<th class=\"data-grid-multicheck-cell\">\r\n    <label data-bind=\"i18n: 'Assign'\"></label>\r\n    <div\r\n        class=\"action-multicheck-wrap\"\r\n        data-bind=\"css: {'_disabled': !totalRecords()},\r\n                   collapsible\">\r\n        <input\r\n            id=\"mass-select-checkbox\"\r\n            class=\"admin__control-checkbox\"\r\n            type=\"checkbox\"\r\n            data-bind=\"checked: allSelected(),\r\n                       event: { change: toggleSelectAll },\r\n                       css: { '_indeterminate': indetermine },\r\n                       enable: totalRecords\"/>\r\n        <label for=\"mass-select-checkbox\"></label>\r\n        <button\r\n            class=\"action-multicheck-toggle\"\r\n            data-toggle=\"dropdown\"\r\n            data-bind=\"css: { '_active': $collapsible.opened },\r\n                       enable: totalRecords,\r\n                       toggleCollapsible\">\r\n            <span data-bind=\"i18n: 'Options'\"></span>\r\n        </button>\r\n        <ul\r\n            class=\"action-menu\"\r\n            data-bind=\"closeCollapsible, foreach: actions\">\r\n            <li data-bind=\"click: $parent[value].bind($parent),\r\n                           visible: $parent.isActionRelevant(value)\">\r\n                <span class=\"action-menu-item\" data-bind=\"text: label\"></span>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</th>\r\n","Magento_Ui/templates/grid/columns/overlay.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div if=\"$col.isVisible($row())\" class=\"masonry-image-overlay\">\r\n    <span text=\"$col.getLabel($row())\"></span>\r\n</div>\r\n","Magento_Ui/templates/grid/columns/text.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<th class=\"data-grid-th\" click=\"sort\"\r\n    css=\"\r\n        _sortable: sortable,\r\n        _draggable: draggable,\r\n        _ascend: sorting === 'asc',\r\n        _descend: sorting === 'desc'\">\r\n    <span class=\"data-grid-cell-content\" translate=\"label\"></span>\r\n</th>\r\n","Magento_Ui/templates/grid/controls/columns.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__action-dropdown-wrap admin__data-grid-action-columns\" collapsible>\r\n    <button class=\"admin__action-dropdown\" type=\"button\" toggleCollapsible>\r\n        <span class=\"admin__action-dropdown-text\" translate=\"'Columns'\"></span>\r\n    </button>\r\n    <div class=\"admin__action-dropdown-menu admin__data-grid-action-columns-menu\" css=\"_overflow: hasOverflow()\">\r\n        <div class=\"admin__action-dropdown-menu-header\" text=\"getHeaderMessage()\"></div>\r\n        <div class=\"admin__action-dropdown-menu-content\">\r\n            <div class=\"admin__field-option\" repeat=\"foreach: elems, item: '$col'\">\r\n                <input class=\"admin__control-checkbox\" type=\"checkbox\"\r\n                    disable=\"isDisabled($col())\"\r\n                    ko-checked=\"$col().visible\"\r\n                    attr=\"id: ++ko.uid\">\r\n                <label class=\"admin__field-label\"\r\n                       translate=\"$col().label\"\r\n                       attr=\"for: ko.uid\"></label>\r\n            </div>\r\n        </div>\r\n        <div class=\"admin__action-dropdown-menu-footer\">\r\n            <div class=\"admin__action-dropdown-footer-secondary-actions\">\r\n                <button class=\"action-tertiary\" type=\"button\" click=\"reset\" translate=\"'Reset'\"></button>\r\n            </div>\r\n            <div class=\"admin__action-dropdown-footer-main-actions\">\r\n                <button class=\"action-tertiary\" type=\"button\" click=\"cancel\" translate=\"'Cancel'\" closeCollapsible></button>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/controls/bookmarks/bookmarks.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__action-dropdown-wrap admin__data-grid-action-bookmarks\" collapsible>\r\n    <button class=\"admin__action-dropdown\" type=\"button\" toggleCollapsible>\r\n        <span class=\"admin__action-dropdown-text\" translate=\"activeView.label\"></span>\r\n    </button>\r\n    <ul class=\"admin__action-dropdown-menu\">\r\n        <!-- ko foreach: { data: viewsArray, as: '$view'}  -->\r\n            <li css=\"_edit: $parent.isEditing($view.index)\" outerClick=\"$parent.endEdit.bind($parent, $view.index)\" template=\"$parent.viewTmpl\"></li>\r\n        <!-- /ko -->\r\n        <li visible=\"hasChanges\" outerClick=\"hideCustom.bind($data)\"\r\n            css=\"\r\n                _edit: customVisible,\r\n                'action-dropdown-menu-action action-dropdown-menu-item-last': !customVisible\">\r\n            <a href=\"\" visible=\"!customVisible\" click=\"showCustom\" translate=\"'Save View As...'\"></a>\r\n            <div class=\"action-dropdown-menu-item-edit\" visible=\"customVisible\">\r\n                <input class=\"admin__control-text\" type=\"text\"\r\n                    data-bind=\"\r\n                        attr: {'aria-label': $t('New View')},\r\n                        value: customLabel,\r\n                        hasFocus: isCustomVisible(),\r\n                        keyboard: {\r\n                            13: applyCustom.bind($data),\r\n                            27: hideCustom.bind($data)\r\n                        }\"/>\r\n                <div class=\"action-dropdown-menu-item-actions\">\r\n                   <button class=\"action-submit\" type=\"button\" click=\"applyCustom\" attr=\"title: $t('Save all changes')\">\r\n                        <span translate=\"'Submit'\"></span>\r\n                    </button>\r\n                </div>\r\n            </div>\r\n        </li>\r\n    </ul>\r\n</div>\r\n","Magento_Ui/templates/grid/controls/bookmarks/view.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"action-dropdown-menu-item-edit\" if=\"$view.editable\">\r\n    <input\r\n        class=\"admin__control-text\"\r\n        data-bind=\"\r\n            value: $view.value,\r\n            hasFocus: $parent.isEditing($view.index),\r\n            attr: {\r\n                placeholder: $view.label\r\n            },\r\n            keyboard: {\r\n                13: $parent.updateAndSave.bind($parent, $view.index),\r\n                27: $parent.endEdit.bind($parent, $view.index)\r\n            }\"\r\n        type=\"text\"/>\r\n    <button class=\"action-submit\" type=\"button\" attr=\"title: $t('Save all changes')\" click=\"$parent.updateAndSave.bind($parent, $view.index)\">\r\n        <span translate=\"'Submit'\"></span>\r\n    </button>\r\n    <div class=\"action-dropdown-menu-item-actions\">\r\n        <button class=\"action-delete\" type=\"button\" attr=\"title: $t('Delete bookmark')\" click=\"$parent.removeView.bind($parent, $view.index)\">\r\n            <span translate=\"'Delete'\"></span>\r\n        </button>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"action-dropdown-menu-item\">\r\n    <a href=\"\" class=\"action-dropdown-menu-link\" translate=\"$view.label\" click=\"$parent.applyView.bind($parent, $view.index)\" closeCollapsible></a>\r\n\r\n    <div class=\"action-dropdown-menu-item-actions\" if=\"$view.editable\">\r\n        <button class=\"action-edit\" type=\"button\" attr=\"title: $t('Edit bookmark')\" click=\"$parent.editView.bind($parent, $view.index)\">\r\n            <span translate=\"'Edit'\"></span>\r\n        </button>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/editing/bulk.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<tr class=\"data-grid-bulk-edit-panel data-grid-editable-row\" each=\"data: fields, as: '$col'\" visible=\"active\">\r\n    <td if=\"$parent.getColumn(index).visible\" css=\"'data-grid-actions-cell': $parent.isActionsColumn($col)\">\r\n        <if args=\"$parent.isActionsColumn($col)\">\r\n            <with args=\"$parent\">\r\n                <button class=\"action-default\" type=\"button\" click=\"apply\" disable=\"!hasData\">\r\n                    <span translate=\"'Apply'\"></span>\r\n                </button>\r\n            </with>\r\n        </if>\r\n\r\n        <if args=\"$data.isEditor\">\r\n            <label class=\"admin__field-label admin__field-label-vertical\" attr=\"for: uid\" translate=\"'All in Column'\"></label>\r\n            <render></render>\r\n        </if>\r\n    </td>\r\n</tr>\r\n","Magento_Ui/templates/grid/editing/field.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__field-control\" css=\" _error: error(), _focus: focused()\">\r\n    <render></render>\r\n    <label class=\"admin__field-error\" attr=\"for: uid\" text=\"error\" visible=\"error() && focused()\"></label>\r\n</div>\r\n","Magento_Ui/templates/grid/editing/header-buttons.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div if=\"isMultiEditing || (hasActive() && (hasMessages() || hasErrors() ))\"\r\n     attr=\"role: (isMultiEditing && multiEditingButtons) ? 'alertdialog' : 'alert'\"\r\n     class=\"data-grid-info-panel\">\r\n    <div if=\"hasMessages() || hasErrors()\" class=\"messages\">\r\n        <div if=\"hasErrors()\" class=\"message message-warning\">\r\n            <strong><text args=\"countErrorsMessage()\"></text></strong>\r\n            <span translate=\"'Please make corrections to the errors in the table below and re-submit.'\"></span>\r\n        </div>\r\n        <div class=\"message\" outereach=\"messages\" text=\"message\"\r\n             css=\"\r\n                 'message-warning': type === 'warning',\r\n                 'message-error': type === 'error',\r\n                 'message-success': type === 'success'\"></div>\r\n    </div>\r\n    <div if=\"isMultiEditing && multiEditingButtons\" class=\"data-grid-info-panel-actions\">\r\n        <button class=\"action-tertiary\" type=\"button\" click=\"cancel\">\r\n            <span translate=\"'Cancel'\"></span>\r\n        </button>\r\n        <button class=\"action-primary\" type=\"button\" click=\"save\" disable=\"!canSave()\">\r\n            <span translate=\"'Save Edits'\"></span>\r\n        </button>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/editing/row-buttons.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<tr class=\"data-grid-editable-row data-grid-editable-row-actions\">\r\n    <td>\r\n        <button class=\"action-tertiary\" type=\"button\" click=\"cancel\">\r\n            <span translate=\"'Cancel'\"></span>\r\n        </button>\r\n        <button class=\"action-primary\" type=\"button\" click=\"save\" disable=\"!canSave()\">\r\n            <span translate=\"'Save'\"></span>\r\n        </button>\r\n    </td>\r\n</tr>\r\n","Magento_Ui/templates/grid/editing/row.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<tr class=\"data-grid-editable-row\" each=\"data: fields, as: '$col'\" css=\"'_odd-row': !!($row()._rowIndex % 2)\">\r\n    <!-- ko if: $parent.getColumn(index).visible -->\r\n\r\n        <td class=\"data-grid-actions-cell\" if=\"$parent.isActionsColumn($data)\">\r\n            <span class=\"data-grid-row-changed\" css=\"_changed: $parent.hasChanges\">\r\n                <span class=\"data-grid-row-changed-tooltip\" translate=\"'Record contains unsaved changes.'\"></span>\r\n            </span>\r\n        </td>\r\n\r\n        <!-- ko ifnot: $parent.isActionsColumn($data) -->\r\n            <td if=\"$col.isEditor\" template=\"$parent.fieldTmpl\"></td>\r\n            <td ifnot=\"$col.isEditor\" css=\"$col.getFieldClass()\" template=\"$col.getBody()\"></td>\r\n        <!-- /ko -->\r\n\r\n    <!-- /ko -->\r\n</tr>\r\n","Magento_Ui/templates/grid/filters/chips.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__data-grid-filters-current\" css=\"_show: hasPreviews()\">\r\n    <div class=\"admin__current-filters-title-wrap\">\r\n        <span class=\"admin__current-filters-title\" translate=\"'Active filters\\\\:'\"></span>\r\n    </div>\r\n    <div class=\"admin__current-filters-list-wrap\">\r\n        <ul class=\"admin__current-filters-list\" data-role=\"filter-list\">\r\n            <each args=\"elems\">\r\n                <li outereach=\"previews\">\r\n                    <span text=\"label + '\\\\:'\"></span>\r\n                    <span if=\"typeof preview === 'string'\" text=\"preview\"></span>\r\n                    <span if=\"typeof preview === 'object'\">\r\n                        <text args=\"preview[0] || '...'\"></text> - <text args=\"preview[1] || '...'\"></text>\r\n                    </span>\r\n                    <button class=\"action-remove\" type=\"button\"\r\n                        data-action=\"grid-filter-remove-chip\"\r\n                        click=\"$parent.clear.bind($parent, elem)\">\r\n                        <span translate=\"'Remove'\"></span>\r\n                    </button>\r\n                </li>\r\n            </each>\r\n        </ul>\r\n    </div>\r\n    <div class=\"admin__current-filters-actions-wrap\">\r\n        <button class=\"action-tertiary action-clear\" type=\"button\" click=\"clear\" translate=\"'Clear all'\"\r\n            attr=\"'data-action': hasPreviews() ? 'grid-filter-reset' : ''\"></button>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/filters/field.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<label class=\"admin__form-field-label\" attr=\"for: uid\">\r\n    <span translate=\"label\"></span>\r\n</label>\r\n<div class=\"admin__form-field-control\" render=\"elementTmpl\"></div>\r\n","Magento_Ui/templates/grid/filters/filters.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"data-grid-filters-actions-wrap\" collapsible=\"openClass: false, closeOnOuter: false\">\r\n    <div class=\"data-grid-filters-action-wrap\">\r\n        <button class=\"action-default\" data-action=\"grid-filter-expand\" disable=\"!hasVisible()\" translate=\"'Filters'\"\r\n            css=\"_active: hasVisible() && $collapsible.opened()\"\r\n            toggleCollapsible></button>\r\n    </div>\r\n</div>\r\n\r\n<scope args=\"chips\" render=\"\"></scope>\r\n\r\n<div class=\"admin__data-grid-filters-wrap\" data-part=\"filter-form\" css=\"_show: hasVisible() && $collapsible.opened()\" keyboard=\"{ 13: apply }\">\r\n    <fieldset class=\"admin__fieldset admin__data-grid-filters\">\r\n        <legend class=\"admin__filters-legend\">\r\n            <span translate=\"'Advanced filter'\"></span>\r\n        </legend>\r\n        <fieldset class=\"admin__form-field\" outereach=\"getRanges()\" visible=\"$parent.isFilterVisible($data)\" render=\"\"></fieldset>\r\n        <div class=\"admin__form-field\" outereach=\"getPlain()\" visible=\"$parent.isFilterVisible($data)\" render=\"\"></div>\r\n    </fieldset>\r\n\r\n    <div class=\"admin__data-grid-filters-footer\">\r\n        <div class=\"admin__footer-main-actions\">\r\n            <button class=\"action-tertiary\" type=\"button\" data-action=\"grid-filter-cancel\" click=\"cancel\" closeCollapsible>\r\n                <span translate=\"'Cancel'\"></span>\r\n            </button>\r\n            <button class=\"action-secondary\" type=\"button\" data-action=\"grid-filter-apply\" click=\"apply\" closeCollapsible>\r\n                <span translate=\"'Apply Filters'\"></span>\r\n            </button>\r\n        </div>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/filters/elements/group.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<legend class=\"admin__form-field-legend\">\r\n    <span translate=\"label\"></span>\r\n</legend>\r\n<div class=\"admin__form-field\" outereach=\"elems\" render=\"\"></div>\r\n","Magento_Ui/templates/grid/filters/elements/ui-select-optgroup.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<ul class=\"admin__action-multiselect-menu-inner\"\r\n    data-bind=\"\r\n    visible: $data.root.showLevels($data.current),\r\n    attr: {\r\n        'data-level': $data.current.level++\r\n    }\">\r\n    <!-- ko if: $data.current.visible() || $data.current.isVisited  -->\r\n    <!-- ko foreach: { data: $data.current.optgroup, as: 'option'}  -->\r\n    <li class=\"admin__action-multiselect-menu-inner-item\"\r\n        data-bind=\"css: { _parent: $data.optgroup }\">\r\n        <div class=\"action-menu-item\"\r\n             data-bind=\"\r\n                css: {\r\n                    _selected: $parent.root.isSelected(option.value),\r\n                    _hover: $parent.root.isHovered(option, $element),\r\n                    _expended: $parent.root.getLevelVisibility($data) || $data.visible,\r\n                    _unclickable: $parent.root.isLabelDecoration($data),\r\n                    _last: $parent.root.addLastElement($data),\r\n                    '_with-checkbox': $parent.root.showCheckbox\r\n                },\r\n                click: function(data, event){\r\n                    $parent.root.toggleOptionSelected($data, $index(), event);\r\n                },\r\n                clickBubble: false\r\n\r\n            \">\r\n            <!-- ko if: $data.optgroup && $parent.root.showOpenLevelsActionIcon-->\r\n            <div class=\"admin__action-multiselect-dropdown\"\r\n                 data-bind=\"\r\n                        click: function(data, event){\r\n                            $parent.root.openChildLevel($data, $element, event);\r\n                        },\r\n                        clickBubble: false\r\n                     \"></div>\r\n            <!-- /ko-->\r\n            <!--ko if: $parent.root.showCheckbox-->\r\n            <input\r\n                    class=\"admin__control-checkbox\"\r\n                    type=\"checkbox\"\r\n                    tabindex=\"-1\"\r\n                    data-bind=\"attr: { 'checked': $parent.root.isSelected(option.value) }\"/>\r\n            <!--/ko-->\r\n            <label\r\n                    class=\"admin__action-multiselect-label\"\r\n                    data-bind=\"text: option.label\">\r\n            </label>\r\n        </div>\r\n        <!-- ko if: $data.optgroup -->\r\n        <!-- ko template: {name: $parent.root.optgroupTmpl, data: {root: $parent.root, current: $data}} -->\r\n        <!-- /ko -->\r\n        <!-- /ko-->\r\n    </li>\r\n    <!-- /ko -->\r\n    <!-- /ko -->\r\n</ul>\r\n","Magento_Ui/templates/grid/filters/elements/ui-select.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<!-- ko ifnot: disableLabel -->\r\n<label\r\n        class=\"admin__form-field-label\"\r\n        data-bind=\"attr: {for: uid}\r\n\">\r\n    <span translate=\"label\"></span>\r\n</label>\r\n<!-- /ko -->\r\n<div\r\n        class=\"admin__action-multiselect-wrap action-select-wrap\"\r\n        tabindex=\"0\"\r\n        data-bind=\"\r\n        attr: {\r\n            id: uid\r\n        },\r\n        css: {\r\n            _active: listVisible,\r\n            'admin__action-multiselect-tree': isTree()\r\n        },\r\n        event: {\r\n            focusin: onFocusIn,\r\n            focusout: onFocusOut,\r\n            keydown: keydownSwitcher\r\n        },\r\n        outerClick: outerClick.bind($data)\r\n\">\r\n    <!-- ko ifnot: chipsEnabled -->\r\n    <div\r\n            class=\"action-select admin__action-multiselect\"\r\n            data-role=\"advanced-select\"\r\n            data-bind=\"\r\n            css: {_active: listVisible},\r\n            click: function(data, event) {\r\n                toggleListVisible(data, event)\r\n            }\r\n    \">\r\n        <div class=\"admin__action-multiselect-text\"\r\n         data-role=\"selected-option\"\r\n         ifnot=\"validationLoading\"\r\n         data-bind=\"\r\n         css: {warning: warn().length},\r\n         text: setCaption()\r\n    \">\r\n    </div>\r\n        <button if=\"isRemoveSelectedIcon && hasData() || !validationLoading\"\r\n                class=\"action-close\"\r\n                type=\"button\"\r\n                data-action=\"remove-selected-item\"\r\n                tabindex=\"-1\"\r\n                click=\"clear\"\r\n        >\r\n            <span class=\"action-close-text\" translate=\"'Close'\"></span>\r\n        </button>\r\n        <div data-role=\"spinner\"\r\n             class=\"admin__data-grid-loading-mask\"\r\n             visible=\"validationLoading\"\r\n             if=\"validationLoading\">\r\n            <div class=\"spinner\">\r\n                <span repeat=\"8\"></span>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <!-- /ko -->\r\n    <!-- ko if: chipsEnabled -->\r\n    <div\r\n            class=\"action-select admin__action-multiselect\"\r\n            data-role=\"advanced-select\"\r\n            data-bind=\"\r\n            css: {_active: listVisible},\r\n            click: function(data, event) {\r\n                toggleListVisible(data, event)\r\n            }\r\n    \">\r\n        <div class=\"admin__action-multiselect-text\"\r\n             data-bind=\"\r\n                visible: !hasData(),\r\n                i18n: selectedPlaceholders.defaultPlaceholder\r\n        \">\r\n        </div>\r\n        <!-- ko foreach: { data: getSelected(), as: 'option'}  -->\r\n            <span class=\"admin__action-multiselect-crumb\">\r\n                <span data-bind=\"text: label\">\r\n                </span>\r\n                <button\r\n                        class=\"action-close\"\r\n                        type=\"button\"\r\n                        data-action=\"remove-selected-item\"\r\n                        tabindex=\"-1\"\r\n                        data-bind=\"click: $parent.removeSelected.bind($parent, value)\r\n                \">\r\n                    <span class=\"action-close-text\" translate=\"'Close'\"></span>\r\n                </button>\r\n            </span>\r\n        <!-- /ko -->\r\n    </div>\r\n    <!-- /ko -->\r\n    <div class=\"action-menu\" css=\"{ _active: listVisible}\">\r\n        <div data-role=\"spinner\"\r\n           class=\"admin__data-grid-loading-mask\"\r\n           visible=\"loading\"\r\n           if=\"loading\">\r\n        <div class=\"spinner\">\r\n            <span repeat=\"8\"></span>\r\n        </div>\r\n    </div>\r\n        <!-- ko if: filterOptions -->\r\n        <div class=\"admin__action-multiselect-search-wrap\">\r\n            <input\r\n                    class=\"admin__control-text admin__action-multiselect-search\"\r\n                    data-role=\"advanced-select-text\"\r\n                    type=\"text\"\r\n                    data-bind=\"\r\n                event: {\r\n                    keydown: filterOptionsKeydown\r\n                },\r\n                attr: {\r\n                    id: uid+2,\r\n                    placeholder: filterPlaceholder\r\n                },\r\n                textInput: filterInputValue,\r\n                hasFocus: filterOptionsFocus\r\n                \">\r\n            <label\r\n                    class=\"admin__action-multiselect-search-label\"\r\n                    data-action=\"advanced-select-search\"\r\n                    data-bind=\"attr: {for: uid+2}\r\n            \">\r\n            </label>\r\n            <div if=\"itemsQuantity\"\r\n                 data-bind=\"text: itemsQuantity\"\r\n                 class=\"admin__action-multiselect-search-count\">\r\n            </div>\r\n        </div>\r\n        <div ifnot=\"options().length\"\r\n             class=\"admin__action-multiselect-empty-area\">\r\n            <ul html=\"getEmptyOptionsUnsanitizedHtml()\"></ul>\r\n        </div>\r\n        <!-- /ko -->\r\n        <ul class=\"admin__action-multiselect-menu-inner _root\"\r\n            data-bind=\"\r\n                event: {\r\n                    scroll: function(data, event){onScrollDown(data, event)}\r\n                }\r\n            \">\r\n            <!-- ko foreach: { data: options, as: 'option'}  -->\r\n            <li class=\"admin__action-multiselect-menu-inner-item _root\"\r\n                data-bind=\"css: { _parent: $data.optgroup }\"\r\n                data-role=\"option-group\">\r\n                <div class=\"action-menu-item\"\r\n                     data-bind=\"\r\n                        css: {\r\n                            _selected: $parent.isSelectedValue(option),\r\n                            _hover: $parent.isHovered(option, $element),\r\n                            _expended: $parent.getLevelVisibility($data) && $parent.showLevels($data),\r\n                            _unclickable: $parent.isLabelDecoration($data),\r\n                            _last: $parent.addLastElement($data),\r\n                            '_with-checkbox': $parent.showCheckbox\r\n                        },\r\n                        click: function(data, event){\r\n                            $parent.toggleOptionSelected($data, $index(), event);\r\n                        },\r\n                        clickBubble: false\r\n                \">\r\n                    <!-- ko if: $data.optgroup && $parent.showOpenLevelsActionIcon-->\r\n                    <div class=\"admin__action-multiselect-dropdown\"\r\n                         data-bind=\"\r\n                            click: function(event){\r\n                                $parent.showLevels($data);\r\n                                $parent.openChildLevel($data, $element, event);\r\n                            },\r\n                            clickBubble: false\r\n                         \">\r\n                    </div>\r\n                    <!-- /ko-->\r\n                    <!--ko if: $parent.showCheckbox-->\r\n                    <input\r\n                            class=\"admin__control-checkbox\"\r\n                            type=\"checkbox\"\r\n                            tabindex=\"-1\"\r\n                            data-bind=\"attr: { 'checked': $parent.isSelected(option.value) }\">\r\n                    <!-- /ko-->\r\n                    <label class=\"admin__action-multiselect-label\">\r\n                        <span data-bind=\"text: option.label\"></span>\r\n                        <span\r\n                                if=\"$parent.getPath(option)\"\r\n                                class=\"admin__action-multiselect-item-path\"\r\n                                data-bind=\"text: $parent.getPath(option)\"></span>\r\n                    </label>\r\n                </div>\r\n                <!-- ko if: $data.optgroup -->\r\n                <!-- ko template: {name: $parent.optgroupTmpl, data: {root: $parent, current: $data}} -->\r\n                <!-- /ko -->\r\n                <!-- /ko-->\r\n            </li>\r\n            <!-- /ko -->\r\n        </ul>\r\n        <!-- ko if: $data.closeBtn -->\r\n        <div class=\"admin__action-multiselect-actions-wrap\">\r\n            <button class=\"action-default\"\r\n                    data-action=\"close-advanced-select\"\r\n                    type=\"button\"\r\n                    data-bind=\"click: outerClick\">\r\n                <span translate=\"closeBtnLabel\"></span>\r\n            </button>\r\n        </div>\r\n        <!-- /ko -->\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/paging/paging-detailed-total.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__control-support-text\">\r\n    <!-- ko if: totalRecords -->\r\n        <strong>\r\n            <text args=\"getFirstItemIndex()\"></text> -\r\n            <text args=\"getLastItemIndex()\"></text>\r\n        </strong>\r\n        <!-- ko i18n: 'of' --><!-- /ko -->\r\n    <!-- /ko -->\r\n    <strong text=\"totalRecords\"></strong>\r\n    <!-- ko i18n: 'records found' --><!-- /ko -->\r\n    <!-- ko if: totalSelected -->\r\n        (<text args=\"totalSelected\"></text> <!-- ko i18n: 'selected' --><!-- /ko -->)\r\n    <!-- /ko -->\r\n</div>\r\n","Magento_Ui/templates/grid/paging/paging.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__data-grid-pager-wrap\">\r\n    <scope args=\"sizes\" render=\"\"></scope>\r\n\r\n    <div class=\"admin__data-grid-pager\">\r\n        <button class=\"action-previous\" type=\"button\" attr=\"title: $t('Previous Page')\" click=\"prev\" disable=\"isFirst()\"></button>\r\n        <!-- ko if: showTotalRecords -->\r\n        <input class=\"admin__control-text\" type=\"number\" data-ui-id=\"current-page-input\" attr=\"id: ++ko.uid\" ko-value=\"_current\">\r\n        <label class=\"admin__control-support-text\" attr=\"for: ko.uid\" text=\"'of ' + pages\"></label>\r\n        <!-- /ko -->\r\n        <button class=\"action-next\" type=\"button\" attr=\"title: $t('Next Page')\" click=\"next\" disable=\"isLast()\"></button>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/paging/sizes.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n\r\n<div class=\"selectmenu\" collapsible=\"\">\r\n    <div class=\"selectmenu-value\" openCollapsible=\"\">\r\n        <input type=\"text\" ko-value=\"_value\" attr=\"id: index\" autoselect aria-labelledby=\"per-page-text\"/>\r\n    </div>\r\n    <button class=\"selectmenu-toggle\"\r\n            type=\"button\"\r\n            css=\"_active: $collapsible.opened\"\r\n            toggleCollapsible\r\n            aria-labelledby=\"per-page-text select-button-text\">\r\n        <span id=\"select-button-text\" translate=\"'Select'\"></span>\r\n    </button>\r\n    <div class=\"selectmenu-items\" css=\"_active: $collapsible.opened\" outerClick=\"discardAll.bind($data)\">\r\n        <ul>\r\n            <li repeat=\"foreach: optionsArray, item: '$size'\" css=\"_edit: isEditing($size().value)\">\r\n                <div class=\"selectmenu-item-edit\" if=\"$size().editable\" keyboard=\"13: updateSize.bind($data, $size().value, false)\">\r\n                    <input class=\"admin__control-text\" type=\"text\"\r\n                        ko-value=\"$size()._value\" hasFocus=\"isEditing($size().value)\"/>\r\n                    <button class=\"action-save\" type=\"button\" click=\"updateSize.bind($data, $size().value, false)\">\r\n                        <span translate=\"'Save'\"></span>\r\n                    </button>\r\n                    <button class=\"action-delete\" type=\"button\" click=\"removeSize.bind($data, $size().value, false)\">\r\n                        <span translate=\"'Delete'\"></span>\r\n                    </button>\r\n                </div>\r\n                <div class=\"selectmenu-item\">\r\n                    <button class=\"selectmenu-item-action\" type=\"button\" text=\"$size().label\" click=\"setSize.bind($data, $size().value)\"></button>\r\n                    <button class=\"action-edit\" type=\"button\" if=\"$size().editable\"\r\n                        data-bind=\"\r\n                            click: function () {\r\n                                discardCustom().edit($size().value);\r\n                            }\">\r\n                        <span translate=\"'Edit'\"></span>\r\n                    </button>\r\n                </div>\r\n            </li>\r\n\r\n            <li css=\"_edit: isCustomVisible()\">\r\n                <div class=\"selectmenu-item\">\r\n                    <button class=\"selectmenu-item-action\" type=\"button\"\r\n                       translate=\"'Custom'\"\r\n                       ko-visible=\"!isCustomVisible()\"\r\n                       data-bind=\"\r\n                            click: function () {\r\n                                $data.showCustom()\r\n                                    .discardEditing();\r\n                            }\"></button>\r\n                </div>\r\n                <div class=\"selectmenu-item-edit\" keyboard=\"13: applyCustom\">\r\n                    <input class=\"admin__control-text\" type=\"text\" ko-value=\"customValue\" hasFocus=\"isCustomVisible()\"/>\r\n                    <button class=\"action-save\" type=\"button\" click=\"applyCustom\">\r\n                        <span translate=\"'Save'\"></span>\r\n                    </button>\r\n                </div>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n<label class=\"admin__control-support-text\" translate=\"'per page'\" attr=\"for: index\" id=\"per-page-text\"></label>\r\n","Magento_Ui/templates/grid/search/search.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"data-grid-search-control-wrap\">\r\n    <label class=\"data-grid-search-label\" attr=\"title: $t('Search'), for: index\" data-bind=\"click: scrollTo\">\r\n        <span translate=\"'Search'\"></span>\r\n    </label>\r\n    <input class=\"admin__control-text data-grid-search-control\" type=\"text\"\r\n            data-bind=\"\r\n                i18n: placeholder,\r\n                attr: {\r\n                    id: index,\r\n                    placeholder: $t(placeholder),\r\n                    'aria-label': $t(placeholder),\r\n                },\r\n                textInput: inputValue,\r\n                hasFocus: focused,\r\n                keyboard: {\r\n                    13: apply.bind($data, false),\r\n                    27: cancel\r\n                }\">\r\n    <button class=\"action-submit\" type=\"button\" click=\"apply.bind($data, false)\" attr=\"'aria-label': $t('Search')\">\r\n        <span translate=\"'Search'\"></span>\r\n    </button>\r\n</div>\r\n","Magento_Ui/templates/grid/sticky/filters.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"data-grid-filters-actions-wrap\">\r\n    <div class=\"data-grid-filters-action-wrap\">\r\n        <button\r\n                class=\"action-default\"\r\n                data-action=\"grid-filter-expand\"\r\n                data-bind=\"\r\n                 click: function(){\r\n                    window.scrollTo(0, 0);\r\n                    $data.trigger('open');\r\n                 },\r\n                 attr: {disabled: !hasVisible()}\"\r\n                 aria-label=\"product-filters\">\r\n            <span data-bind=\"i18n: 'Filters'\"></span>\r\n        </button>\r\n        <span class=\"filters-active\" data-bind=\"text: countActive() || ''\"></span> <!-- Added the amount of selected filters -->\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/grid/sticky/listing.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div class=\"admin__data-grid-wrap\" data-role=\"sticky-el-root\">\r\n    <table class=\"data-grid\">\r\n        <thead>\r\n            <tr each=\"data: getVisible(), as: '$col'\" render=\"getHeader()\"></tr>\r\n        </thead>\r\n        <tbody></tbody>\r\n    </table>\r\n</div>\r\n","Magento_Ui/templates/grid/sticky/sticky.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<div style=\"display: none;\" css=\"stickyClass\" afterRender=\"setStickyNode\">\r\n    <span class=\"data-grid-cap-left\" afterRender=\"setLeftCap\"></span>\r\n    <span class=\"data-grid-cap-right\" afterRender=\"setRightCap\"></span>\r\n\r\n    <div afterRender=\"setStickyToolbarNode\">\r\n        <div class=\"admin__data-grid-header\">\r\n            <div class=\"admin__data-grid-header-row\">\r\n                <scope args=\"requestChild('listing_massaction')\" render=\"\"></scope>\r\n                <scope args=\"requestChild('listing_paging')\" render=\"totalTmpl\"></scope>\r\n                <each args=\"getRegion('dataGridFilters')\" render=\" $data.stickyTmpl || getTemplate()\"></each>\r\n                <div class=\"admin__data-grid-actions-wrap\" each=\"getRegion('dataGridActions')\" render=\"\"></div>\r\n                <scope args=\"requestChild('listing_paging')\" render=\"\"></scope>\r\n            </div>\r\n        </div>\r\n\r\n        <scope args=\"requestChild('listing_filters_chips')\" render=\"$data.stickyTmpl || getTemplate()\"></scope>\r\n\r\n        <scope args=\"columnsProvider\" render=\"stickyTmpl\"></scope>\r\n    </div>\r\n</div>\r\n","Magento_Ui/templates/group/group.html":"<!--\r\n/**\r\n * Copyright \u00a9 Magento, Inc. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<fieldset class=\"field\" data-bind=\"css: additionalClasses\">\r\n    <legend class=\"label\">\r\n        <span translate=\"element.label\"></span>\r\n    </legend>\r\n    <div class=\"control\">\r\n        <!-- ko foreach: { data: elems, as: 'element' } -->\r\n\r\n            <!-- ko if: element.visible() -->\r\n\r\n                <!-- ko ifnot: (element.input_type == 'checkbox' || element.input_type == 'radio') -->\r\n                    <!-- ko template: $parent.fieldTemplate --><!-- /ko -->\r\n                <!-- /ko -->\r\n\r\n                <!-- ko if: (element.input_type == 'checkbox' || element.input_type == 'radio') -->\r\n                    <!-- ko template: element.elementTmpl --><!-- /ko -->\r\n                <!-- /ko -->\r\n\r\n            <!-- /ko -->\r\n\r\n        <!-- /ko -->\r\n\r\n        <!-- ko if: validateWholeGroup -->\r\n        <!-- ko  foreach: { data: elems, as: 'element' } -->\r\n            <!-- ko if: element.error() && element.visible() -->\r\n                <label class=\"error\" data-bin