n            <!-- ko foreach: getRegion('customer-email') -->\r\n                <!-- ko template: getTemplate() --><!-- /ko -->\r\n            <!--/ko-->\r\n        <!--/ko-->\r\n        <!-- ko if: !isAmazonAccountLoggedIn() -->\r\n            <!-- ko if: (addressOptions.length > 1) -->\r\n                <!-- ko template: 'Magento_Checkout/billing-address/list' --><!-- /ko -->\r\n            <!-- /ko -->\r\n        <!-- ko if: isAddressFormVisible -->\r\n            <!-- ko template: 'Magento_Checkout/billing-address/form' --><!-- /ko -->\r\n        <!-- /ko -->\r\n\r\n        <div class=\"mp-clear\"></div>\r\n\r\n            <!-- ko if: (!isCustomerLoggedIn() && quoteIsVirtual) -->\r\n                <!-- ko foreach: getRegion('customer-email') -->\r\n                    <!-- ko template: 'Mageplaza_Osc/container/address/billing/create' --><!-- /ko -->\r\n                <!--/ko-->\r\n            <!--/ko-->\r\n        <!--/ko-->\r\n\r\n\r\n        <div class=\"mp-clear\"></div>\r\n    </div>\r\n</div>","Mageplaza_Osc/template/container/address/shipping-address.html":"<!--\r\n/**\r\n * Mageplaza\r\n *\r\n * NOTICE OF LICENSE\r\n *\r\n * This source file is subject to the Mageplaza.com license that is\r\n * available through the world-wide-web at this URL:\r\n * https://www.mageplaza.com/LICENSE.txt\r\n *\r\n * DISCLAIMER\r\n *\r\n * Do not edit or add to this file if you wish to upgrade this extension to newer\r\n * version in the future.\r\n *\r\n * @category    Mageplaza\r\n * @package     Mageplaza_Osc\r\n * @copyright   Copyright (c) Mageplaza (https://www.mageplaza.com/)\r\n * @license     https://www.mageplaza.com/LICENSE.txt\r\n */\r\n-->\r\n\r\n<div id=\"shipping\" class=\"checkout-shipping-address\" data-bind=\"fadeVisible: visible()\">\r\n    <div class=\"step-title\" data-role=\"title\">\r\n        <i class=\"fa fa-home\"></i>\r\n        <!-- ko if: window.checkoutConfig.oscConfig.isUsedMaterialDesign -->\r\n        <span class=\"fa-stack fa-2x\">\r\n            <i class=\"fa fa-circle fa-stack-2x\"></i>\r\n            <strong class=\"fa-stack-1x fa-stack-text fa-inverse\">1</strong>\r\n        </span>\r\n        <!-- /ko -->\r\n        <span data-bind=\"i18n: 'Shipping Address'\"></span>\r\n    </div>\r\n    <div id=\"checkout-step-shipping\"\r\n         class=\"step-content\"\r\n         data-role=\"content\">\r\n\r\n        <!-- ko if: (!quoteIsVirtual) -->\r\n            <!-- ko foreach: getRegion('customer-email') -->\r\n                <!-- ko template: getTemplate() --><!-- /ko -->\r\n            <!--/ko-->\r\n        <!--/ko-->\r\n\r\n        <!-- ko foreach: getRegion('address-list') -->\r\n        <!-- ko template: getTemplate() --><!-- /ko -->\r\n        <!--/ko-->\r\n\r\n        <!-- ko foreach: getRegion('address-list-additional-addresses') -->\r\n        <!-- ko template: getTemplate() --><!-- /ko -->\r\n        <!--/ko-->\r\n\r\n        <!-- Address form pop up -->\r\n        <!-- ko if: (!isFormInline) -->\r\n        <button type=\"button\"\r\n                data-bind=\"click: showFormPopUp, visible: !isNewAddressAdded()\"\r\n                class=\"action action-show-popup\">\r\n            <span data-bind=\"i18n: 'New Address'\"></span></button>\r\n        <div id=\"opc-new-shipping-address\" data-bind=\"visible: isFormPopUpVisible()\">\r\n            <!-- ko template: 'Mageplaza_Osc/container/address/shipping/form' --><!-- /ko -->\r\n        </div>\r\n        <!-- /ko -->\r\n\r\n        <!-- ko foreach: getRegion('before-form') -->\r\n        <!-- ko template: getTemplate() --><!-- /ko -->\r\n        <!--/ko-->\r\n\r\n        <!-- ko if: !isAmazonAccountLoggedIn() -->\r\n            <!-- Inline address form -->\r\n            <!-- ko if: (isFormInline) -->\r\n            <!-- ko template: 'Mageplaza_Osc/container/address/shipping/form' --><!-- /ko -->\r\n            <!-- /ko -->\r\n\r\n            <!-- ko if: (!isCustomerLoggedIn() && !quoteIsVirtual) -->\r\n                <!-- ko foreach: ge